import React, {Component} from 'react';
import server from './constants/server';
import './assets/styles/main.scss';
import axios from 'axios';

interface AppState {
  requested: boolean,
  carriesWin: any;
  carriesTop: any,
  totalMatches: number;
}

class App extends Component <{}, AppState> {
  constructor(props: object) {
    super(props);
    this.state = {
        requested: false,
        carriesWin: {},
        carriesTop: {},
        totalMatches: 1,
    };
  }

  componentDidMount() { 
    axios.get(server + '/tft/summoner').then(response => {
      this.setState({...response.data, requested: true});
    })
  }

  render() { 
    const { requested, carriesWin, carriesTop, totalMatches } = this.state;

    return(
      <div className="App">
        <h3>TFT Insights</h3>
        {!requested && (
          <div className="spinner"><div className="lds-roller"><div></div><div></div><div></div><div></div><div></div><div></div><div></div><div></div></div></div>
        )}
      </div>
    );
  }
}

export default App;
